import './App.css';

function App() 
{
  const [msg, setMsg] = useState('');

  const getMsg = (e) => 
  {
      console.log("got Message...");
      setMsg(e.target.value);
  }

  return (
    <div className="App">

        <h1> Covid-19 ChatBot</h1>
        <div className="chat-container">
        <div className="msg"> 
          <input 
            type = "text" 
            placeholder="Enter message here"
            onChange={getMsg}
            value={msg} 
            />
          <button onClick={getMsg}>Send</button></div>
          {setMsg}

      </div>
    </div>
  );
}

export default App;
